DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `account` varchar(40) DEFAULT NULL COMMENT '用户登陆名',
  `password` varchar(60) DEFAULT NULL,
  `type` int(2) DEFAULT '1',
  `uid` varchar(100) DEFAULT NULL,
  `realname` varchar(50) DEFAULT NULL COMMENT '用户真实姓名',
  `telphone` varchar(20) DEFAULT NULL COMMENT '办公电话',
  `mobphone` varchar(20) DEFAULT NULL COMMENT '个人电话',
  `email` varchar(150) DEFAULT NULL COMMENT '电子邮箱',
  `identity_flag` varchar(20) DEFAULT NULL,
  `survival_flag` varchar(20) DEFAULT NULL,
  `area` varchar(100) DEFAULT NULL COMMENT '家庭住址',
  `head_url` varchar(255) DEFAULT NULL,
  `channels` varchar(20) DEFAULT '1' COMMENT '注册通道\r\n            1、前台注册  2、IPsa注册  3、后台注册',
  `company` varchar(255) DEFAULT NULL COMMENT '所在公司',
  `dept` varchar(32) DEFAULT NULL,
  `iscertified` int(2) DEFAULT NULL,
  `commit_account` varchar(32) DEFAULT NULL,
  `commit_date` datetime DEFAULT NULL,
  `delete_date` datetime DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `space_depart_id` int(11) DEFAULT NULL,
  `space_depart_name` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=558 DEFAULT CHARSET=utf8 COMMENT='用户信息';

